def plot_histogram_divide(case):
	# plt.rcParams['font.sans-serif']=['SimHei'] # 解决中文乱码
	if case == 'N':
		labels = ['Clipart', 'Infograph', 'Painting', 'Quickdraw', 'Real', 'Sketch', 'Average']
		poss1 = [0.55016, 0.28584, 0.44266, 0.7508, 0.62366, 0.45666, 0.5182966667]
		poss2 = [0.52812, 0.2688, 0.42132, 0.6776, 0.57734, 0.40472, 0.47965]
		poss3 = [0.5342, 0.27946, 0.42746, 0.7482, 0.60476, 0.42166, 0.5026233333]
	elif case == 'C':
		labels = ['Amazon', 'Caltech', 'DSLR', 'WebCam', 'Average']
		poss1 = [0.6302, 0.49068, 0.89374, 0.96614, 0.74519]
		poss2 = [0.6271, 0.46754, 0.8625, 0.88138, 0.70963]
		poss3 = [0.61564, 0.46668, 0.89996, 0.95934, 0.735405]
	elif case == 'D':
		labels = ['MNIST', 'SVHN', 'USPS', 'SynthDigits', 'MNIST-M', 'Average']
		poss1 = [0.97664, 0.77562, 0.97784, 0.88682, 0.87844, 0.899072]
		poss2 = [0.97534, 0.67912, 0.97538, 0.88422, 0.8782, 0.878452]
		poss3 = [0.9759, 0.739, 0.97602, 0.8812, 0.87912, 0.890248]

	x = np.arange(len(labels))  # 标签位置
	width = 0.25  # 柱状图的宽度，可以根据自己的需求和审美来改
	 
	fig, ax = plt.subplots()
	rects1 = ax.bar(x , poss1, width, label='Personalize BN')
	rects2 = ax.bar(x+width, poss2, width, label='Personalize Head')
	rects3 = ax.bar(x+width+width, poss3, width, label='Personalize BN and Head')
	# rects1 = ax.bar(x, g_branch, width, label='FedBN')
	# rects2 = ax.bar(x+width, p_branch, width, label='Local Training')
	 	 
	# 为y轴、标题和x轴等添加一些文本。
	ax.set_ylabel('Accuracy', fontsize=14)
	# ax.set_xlabel('Client IDs', fontsize=14)
	if case == 'N':
		ax.set_title("Performance Comparison on DomainNet")
	elif case == 'C':
		ax.set_title("Performance Comparison on Office-Caltech10")
	elif case == 'D':
		ax.set_title("Performance Comparison on Digits")
	ax.set_xticks(x + 3*width/3)
	# ax.set_xticks(x + width/2)
	ax.set_xticklabels(labels)
	plt.ylim(0.0, 1.0)
	ax.legend(bbox_to_anchor=(0.5, -0.25),loc=8,ncol=4)
	fig.tight_layout()
	ax.spines['right'].set_color('none')
	ax.spines['top'].set_color('none')
	ax.spines['left'].set_color('none')
	ax.spines['bottom'].set_color('none')
	plt.tick_params(axis='x', labelsize=8)
	plt.savefig(case+'_Individual.png')

